import { Listaclienti } from "../../actions/authAutentications";
import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { GoogleMap , withScriptjs, withGoogleMap} from "react-google-maps";

//componenti da react-bootstrap
import { Container, Col, Row } from "react-bootstrap";


function Mappa(){
  return <GoogleMap defaultZoom={10} defaultCenter={{lat: 38.115688, lng: 13.361267}}/>;

}

const WrappedMap = withScriptjs(withGoogleMap(Mappa));

export default function App(){
  return <div>
    <WrappedMap googleMapURL={"https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places"}
    loadingElement={<div style={{ height: `100%` }}/>}
    containerElement={<div style={{ height: `400px` }} />}
  mapElement={<div style={{ height: `100%` }} />}
    />
  </div>
}
